import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import axiosInstance from "../api/axiosConfig";
import Layout from "../components/Layout";
import "../styles/Post.css";

function PostListing() {
  const [universities, setUniversities] = useState([]);
  const [formData, setFormData] = useState({
    user_id: JSON.parse(localStorage.getItem("currentUser"))?.id || "",
    university_id: "",
    title: "",
    building_name: "",
    building_type: "House",
    address: "",
    description: "",
    bedrooms: "1",
    bathrooms: "1",
    monthly_rent: "",
    security_deposit: "",
    lease_type: "Lease",
    lease_duration: "1",
    sq_feet: "",
    amenities: "",
    fees_policies: "",
    contact_email: "",
    contact_mobile: "",
    photos: [],
  });
  const navigate = useNavigate();

  useEffect(() => {
    // Fetch universities for dropdown
    axiosInstance
      .get("/api/universities")
      .then((response) => setUniversities(response.data))
      .catch((error) => console.error("Error fetching universities:", error));
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleFileChange = (e) => {
    setFormData({ ...formData, photos: e.target.files });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Prepare form data for submission
    const payload = new FormData();
    Object.keys(formData).forEach((key) => {
      if (key === "photos") {
        Array.from(formData.photos).forEach((file) => {
          payload.append("photos", file);
        });
      } else {
        payload.append(key, formData[key]);
      }
    });

    axiosInstance
      .post("/api/listings", payload, {
        headers: { "Content-Type": "multipart/form-data" },
      })
      .then((response) => {
        alert("Listing created successfully!");
        navigate(`/listings/${response.data.id}`); // Navigate to the listing details page
      })
      .catch((error) => console.error("Error creating listing:", error));
  };

  return (
    <Layout>
      <div className="container mt-5">
        <h2 className="mb-4">Post a Listing</h2>
        <form onSubmit={handleSubmit} encType="multipart/form-data">
          <div className="mb-3">
            <label htmlFor="university_id" className="form-label">
              University
            </label>
            <select
              name="university_id"
              id="university_id"
              className="form-select"
              value={formData.university_id}
              onChange={handleChange}
              required
            >
              <option value="">Select University</option>
              {universities.map((uni) => (
                <option key={uni.id} value={uni.id}>
                  {uni.name}
                </option>
              ))}
            </select>
          </div>

          {/* Input fields for listing details */}
          {[
            { label: "Title", name: "title", type: "text" },
            { label: "Building Name", name: "building_name", type: "text" },
            { label: "Address", name: "address", type: "text" },
            { label: "Description", name: "description", type: "textarea" },
            { label: "Monthly Rent", name: "monthly_rent", type: "number" },
            { label: "Security Deposit", name: "security_deposit", type: "number" },
            { label: "Square Feet", name: "sq_feet", type: "number" },
            { label: "Amenities", name: "amenities", type: "text", placeholder: "AC, Parking" },
            { label: "Fees & Policies", name: "fees_policies", type: "textarea" },
            { label: "Contact Email", name: "contact_email", type: "email" },
            { label: "Contact Mobile", name: "contact_mobile", type: "tel" },
          ].map((field) => (
            <div className="mb-3" key={field.name}>
              <label htmlFor={field.name} className="form-label">
                {field.label}
              </label>
              {field.type === "textarea" ? (
                <textarea
                  name={field.name}
                  id={field.name}
                  className="form-control"
                  value={formData[field.name]}
                  onChange={handleChange}
                  placeholder={field.placeholder || ""}
                  required
                ></textarea>
              ) : (
                <input
                  type={field.type}
                  name={field.name}
                  id={field.name}
                  className="form-control"
                  value={formData[field.name]}
                  onChange={handleChange}
                  placeholder={field.placeholder || ""}
                  required
                />
              )}
            </div>
          ))}

          <div className="mb-3">
            <label htmlFor="building_type" className="form-label">
              Building Type
            </label>
            <select
              name="building_type"
              id="building_type"
              className="form-select"
              value={formData.building_type}
              onChange={handleChange}
              required
            >
              <option value="House">House</option>
              <option value="Apartment">Apartment</option>
              <option value="Studio">Studio</option>
              <option value="Condo">Condo</option>
              <option value="Townhome">Townhome</option>
            </select>
          </div>

          <div className="mb-3">
            <label htmlFor="bedrooms" className="form-label">
              Number of Bedrooms
            </label>
            <select
              name="bedrooms"
              id="bedrooms"
              className="form-select"
              value={formData.bedrooms}
              onChange={handleChange}
              required
            >
              {Array.from({ length: 10 }, (_, i) => i + 1).map((num) => (
                <option key={num} value={num}>
                  {num}
                </option>
              ))}
            </select>
          </div>

          <div className="mb-3">
            <label htmlFor="bathrooms" className="form-label">
              Number of Bathrooms
            </label>
            <select
              name="bathrooms"
              id="bathrooms"
              className="form-select"
              value={formData.bathrooms}
              onChange={handleChange}
              required
            >
              {Array.from({ length: 10 }, (_, i) => i + 1).map((num) => (
                <option key={num} value={num}>
                  {num}
                </option>
              ))}
            </select>
          </div>

          <div className="mb-3">
            <label htmlFor="lease_type" className="form-label">
              Lease Type
            </label>
            <select
              name="lease_type"
              id="lease_type"
              className="form-select"
              value={formData.lease_type}
              onChange={handleChange}
              required
            >
              <option value="Lease">Lease</option>
              <option value="Sublease">Sublease</option>
            </select>
          </div>

          <div className="mb-3">
            <label htmlFor="lease_duration" className="form-label">
              Lease Duration (in months)
            </label>
            <select
              name="lease_duration"
              id="lease_duration"
              className="form-select"
              value={formData.lease_duration}
              onChange={handleChange}
              required
            >
              {Array.from({ length: 12 }, (_, i) => i + 1).map((num) => (
                <option key={num} value={num}>
                  {num}
                </option>
              ))}
            </select>
          </div>

          <div className="mb-3">
            <label htmlFor="photos" className="form-label">
              Upload Photos
            </label>
            <input
              type="file"
              name="photos"
              id="photos"
              className="form-control"
              multiple
              accept="image/jpeg, image/png, image/jpg"
              onChange={handleFileChange}
            />
          </div>

          <button type="submit" className="btn btn-primary">
            Post Listing
          </button>
        </form>
      </div>
    </Layout>
  );
}

export default PostListing;
